<?php
require_once('./base/modelo.php');

class PostFotos extends modelo{

    public function __construct(){
        parent::__construct();
    }

    public function saveFoto($path,$tracking,$fechaCel){

        $stmt = $this->_db->prepare("INSERT INTO epsaec.fotos(tracking,img,fecha)VALUES(?,?,?) ");
        $rc = $stmt->bind_param("sss",$tracking,$path,$fechaCel);
        $this->_db->set_charset("utf8");
        printf("Conjunto de caracteres actual: %s\n", $this->_db->character_set_name());

        $stmt->execute();
        $stmt->close();
    }

}

